O PRESENTE INSTRUMENTO TEM POR OBJETO A DELEGAÇÃO DAS ATRIBUIÇÕES DE AUTORIDADE DE TRÂNSITO PREVISTAS NO ART. 20, DA LEI Nº 9.503, DE 23 DE SETEMBRO DE 1997, À AUTORIDADE DELEGADA, PARA FISCALIZAÇÃO DAS NORMAS DE TRÂNSITO PELOS AGENTES MUNICIPAIS DE TRÂNSITO DA GUARDA MUNICIPAL DE ARAPONGAS, NOS TRECHOS EM QUE A NATUREZA DO TRÁFEGO SEJA SIMILAR À DE PERÍMETRO URBANO, SEM PREJUÍZO DA ATUAÇÃO CONCORRENTE DA AUTORIDADE DELEGANTE, E NOS TERMOS DA LEGISLAÇÃO DE TRÂNSITO VIGENTE, INCLUINDO, E SEM PREJUÍZO DE OUTRAS, AS SEGUINTES ATIVIDADES:

1.1.1. INSTALAÇÃO E OPERAÇÃO DE EQUIPAMENTOS FIXOS AUTOMÁTICOS DESTINADOS À FISCALIZAÇÃO ELETRÔNICA DE AVANÇO DE SINAL VERMELHO DE SEMÁFORO, DE PARADA IRREGULAR SOBRE FAIXA DE PEDESTRE, DE CONVERSÃO PROIBIDA E DE VELOCIDADE EM RODOVIAS FEDERAIS, EXCETO REDUTOR DE VELOCIDADE;

1.1.2. SUSPENSÃO, CANCELAMENTO E REATIVAÇÃO DE AUTOS DE INFRAÇÃO;

1.1.3. JULGAMENTO DE DEFESAS DE AUTUAÇÃO E DE RECURSOS DE MULTA;

1.1.4. EXPEDIÇÃO DA NOTIFICAÇÃO DA AUTUAÇÃO, IMPOSIÇÃO DA PENALIDADE DE MULTA, EXPEDIÇÃO DA NOTIFICAÇÃO CORRESPONDENTE E ARRECADAÇÃO DAS MULTAS IMPOSTAS;

1.1.5. REFERENDAMENTO DAS IMAGENS E HOMOLOGAÇÃO DOS AUTOS DE INFRAÇÃO;

1.1.6. PATRULHAMENTO VIÁRIO, FISCALIZAÇÃO E OPERAÇÃO DE TRÂNSITO ATRAVÉS DE AGENTES DE AUTORIDADE DE TRÂNSITO DA INTERVENIENTE ANUENTE, COM APLICAÇÃO DAS PENALIDADES E MEDIDAS ADMINISTRATIVAS PREVISTAS NO CÓDIGO DE TRÂNSITO BRASILEIRO, BEM COMO AQUELAS DEFINIDAS PELO CONTRAN E PELA SENATRAN, DE COMPETÊNCIA PRÓPRIA DA DELEGANTE, OBSERVADOS OS LIMITES E CONDIÇÕES ESTABELECIDOS NO PRESENTE ACORDO. 

1.2. NÃO SERÃO OBJETO DE DELEGAÇÃO DESTE ACORDO DE COOPERAÇÃO TÉCNICA AS COMPETÊNCIAS RELACIONADAS NOS INCISOS II, IV, V E XIII DO REFERIDO ART. 20, DA LEI Nº 9.503, DE 23 DE SETEMBRO DE 1997, BEM COMO AS ATIVIDADES RELACIONADAS AO SERVIÇO DE ESCOLTA DE VEÍCULOS DE CARGAS SUPERDIMENSIONADAS OU PERIGOSAS.

1.3. O PRESENTE ACORDO TEM COMO OBJETO O TRECHO RODOVIÁRIO LOCALIZADO ENTRE O KM 181 E O KM 188, DA BR 369, RODOVIA FEDERAL FISCALIZADA PELA SUPERINTENDÊNCIA DA POLÍCIA RODOVIÁRIA FEDERAL NO PARANÁ.

1.4. AO ENTE DELEGADO CABERÁ, NO TRECHO OBJETO DA DELEGAÇÃO, GARANTIR OBEDIÊNCIA ÀS NORMAS RELATIVAS À SEGURANÇA DE TRÂNSITO, DE FORMA A ASSEGURAR A LIVRE CIRCULAÇÃO E A PREVENIR SINISTROS.

1.5. O PRESENTE ACORDO NÃO IMPLICA TRANSFERÊNCIA DE RECURSOS ENTRE AS PARTES. 

1.6. É VEDADA A SUBDELEGAÇÃO DA AUTORIDADE DE TRÂNSITO OBJETO DO PRESENTE ACORDO DE COOPERAÇÃO TÉCNICA.
